import React, {FC} from "react";
import { useLocation } from "react-router-dom";

const Breadcrumbs: FC = () => {

    const location = useLocation()
    console.log(location)

    let currentLink:any = ''
    const crumbs = location.pathname.split('/')
        .filter(crumb => crumb !== '')
        .map ( crumb => {
            currentLink =+ `/${crumb}`

            return (
                <div key={crumb}>

                </div>
            )

        })

    return (
        <div>Breadcrumbs </div>
    )
}

export default Breadcrumbs
